t.RandomizeMaps=t.flag("Wm",{name:"Randomize maps",text:"Individual maps are randomized.  For now this is only a subset of\n           possible maps.  A randomized map will have all the same features\n           (exits, chests, NPCs, etc) except things are moved around.",hard:!0});t.ShuffleAreas=t.flag("Wa",{name:"Shuffle areas",text:"Shuffles some or all area connections.",hard:!0});
