zb.BattleMagic=zb.flag("Nw",{name:"Battle magic not guaranteed",text:"Normally, the logic will guarantee that level 3 sword charges are\n           available before fighting the tetrarchs (with the exception of Karmine,\n           who only requires level 2).  This disables that check.",hard:!0});
zb.MatchingSword=zb.flag("Ns",{name:'Matching sword not guaranteed ("Tink Mode")',text:'Enables "tink strats", where wrong-element swords will still do a\n           single damage per hit.  Player may be required to fight monsters\n           (including bosses) with tinks.',hard:!0});
zb.Barrier=zb.flag("Nb",{name:"Barrier not guaranteed",text:"Normally, the logic will guarantee Barrier (or else refresh and shield\n           ring) before entering Stxy, the Fortress, or fighting Karmine.  This\n           disables that check.",hard:!0});
zb.GasMask=zb.flag("Ng",{name:"Gas mask not guaranteed",text:"The logic will not guarantee gas mask before needing to enter the swamp,\n           nor will leather boots (or hazmat suit) be guaranteed to cross long\n           stretches of spikes.  Gas mask is still guaranteed to kill the insect.",hard:!0});class yb extends Bb{constructor(){super(...arguments);this.prefix="H";this.name="Hard mode"}}
